import '../../App.css';

function Home() {
    return(
        <div className="home">
            <h1>Home</h1>
            <div>
            <iframe title="Livestream-video" src="https://vimeo.com/event/2049063/embed" frameborder="0" allow="autoplay; fullscreen; picture-in-picture" allowfullscreen></iframe>
          </div>

          <iframe title="QA-chat"src="https://vimeo.com/event/2048912/chat/" width="400" height="600" frameborder="0"></iframe>
        </div>
    );
}

export default Home;
